snippet.textDisplay:
1. AMD's reasoning is B all the way to the T. 'Not enough ROM size' my arse. The MSI B450 Tomahawk MAX and almost all decent X470 motherboards have 256Mb SPI Flash ROM which is the exact same as X570 motherboards;

2. If they really couldn't support older motherboards, why the hell didn't they release B550 chipset earlier? B550 motherboards coming almost a year after 3rd gen launch is a joke. X570's out-of-reach prices and fairly useless features for the average user forced buyers to go with B450 or X470 motherboards and they knew that, still did nothing. At least put that on your roadmap to give people a hint;

3. They want people with 'older' motherboards to go out and buy an expensive motherboard (B550 are still gonna be $100+ minimum) that is at the end of its life because Zen4 and/or DDR5 are inevitably coming next year with new socket/motherboard design? AMD just shot itself in the foot.

/Rant's over.

